import React from "react";

const Skills = () => {
  return (
      <div className="row justify-content-center orangebg ojbottom">
        <div className="col-md-4 skillcol" id="#skills">
          <h3>Front-End Developer</h3>
          <ul className="skilllist">
            <li>React</li>
            <li>JavaScript</li>
            <li>HTML</li>
            <li>CSS</li>
            <li>Bootstrap</li>
            <li>Blender</li>
            <li>GraphQL</li>
            <li>Node.js</li>
            <li>Express</li>
            <li>MongoDB</li>
            <li>Git</li>
          </ul>
        </div>
      </div>
  );
};

export default Skills;
